import React from 'react';
import '../App.css';
import ListItem from './ListItem';

const Dashboard = () => {
    return (
        <>
        <input type="text" placeholder="Recherche" />
        <div className="container-app">
            <ListItem />
        </div>
        </>
    )
}

export default Dashboard
